export interface Subject {
  id: number;
  name: string;
  description: string;
}

export const subjects = [
  {
    id: 1,
    name: 'GENPHY',
    description: 'General Physics',
  },
  {
    id: 2,
    name: 'ENG',
    description: 'English',
  },
  {
    id: 3,
    name: 'ALG1',
    description: 'Algebra 1',
  },
  {
    id: 4,
    name: 'CAP',
    description: 'Capstone 1',
  }
];
